Requirements: Android OS 1.5+
Overview: Track your sleep and wake up gently with nature sounds in optimal sleep phase
Alarm clock with sleep cycle tracker. 


Wakes you gently in light sleep for pleasant mornings. Features: sleep graph history, sleep debt stats, sharing (FaceBook, email), nature alarms (birds, sea, storm...) with gradual volume up, music volume down when asleep, captcha, sleep talk/snoring recording

What's in this version:
-Nature sounds lullabies (tracking menu-&gt;lullaby): Diving with whales,Deep in caves,Fireplace,Stream.. best with &quot;Lullaby volume down&quot;
-Alarm playlist:Random sound is picked from the playlist to wake you up
-More nature sound alarms in full version
-Fixes for beep-beep alarm sound (please reset your alarm ringtones)
-Fixed for unintended airplane enable
-Fix for hanging ExportService
-Alarm auto-kill won't stop tracking
New translations: French,Czech,Dutch,Ukrainian,Russian (many thanks guys)

                                By bobiras2009
